const logIn = (fname = null) => {
    return { 
        type : 'LOG IN',
        payload : fname
    }
}

const register = (fname = null) => {
    return { 
        type : 'REGISTER',
        payload : fname
    }
}

const logOut = () => {
    return { 
        type : 'LOG OUT',
        payload : null
    }
}

export { logIn, register, logOut }
